import React ,{Component} from 'react';

class ImageCaraousel extends Component
{
   

    render()
    {
        let i=0;
        return (
            <div className="carousel">
                <table>
                    <tr>
                        <td>
                        <button onClick={()=>{this.props.onPrevious(i++)}} className="carousel-previous-btn"> Previous</button>

                        </td>
                        <td>
                        <img src="https://i1.sndcdn.com/artworks-000482183808-s7h0nx-t500x500.jpg" alt="carousel-image" id="carouselItem"/>

                        </td>
                        <td>
                        <button onClick={()=>{this.props.onNext(i--)}}  className="carousel-next-btn"> Next</button>
                        </td>
                    </tr>
                </table>

            </div>
    
                );
    }
   
}

export default ImageCaraousel;
